//Contact

//Intro
.Contact_Intro {
    width: 100%;
    margin: 100px 0px;
    margin-top: 120px;
}

    .Contact_Intro-Wrap {
        width: 100%;
        position: relative;
        display: flex;
        justify-content: space-between;
    }   

        .Contact_Intro-Header {
            width: 50%;
            font-size: 70px;
            font-weight: 600;
            letter-spacing: -3px;
            opacity: 0;
            transition: all .6s ease-in;
        }

            .Contact_Intro-Right {
                width: 50%;
                padding-left: 40px;
                margin-top: 120px;
                font-size: 24px;
                font-weight: 500;
                line-height: 46px;
                opacity: 0;
                color: rgb(137, 137, 137);
                transition: all .6s ease-in;
            }


@media screen and (max-height: 700px){
    .Contact_Intro {
        margin-top: 80px;
        margin-bottom: 60px;
    }
    .Contact_Intro-Header {
        font-size: 60px;
    }
    .Contact_Intro-Right {
        padding: 0;
        font-size: 18px;
        font-weight: 400;
    }
}

@media screen and (max-width: 900px){
    .Contact_Intro-Wrap {
        display: block;
    }
    .Contact_Intro-Header {
        width: 100%;
    }
    .Contact_Intro-Right {
        width: 100%;
        margin-top: 40px;
        padding-left: 0;
    }
}

@media screen and (max-width: 700px){
    .Contact_Intro-Header {
       font-size: 50px;
       margin-top: 60px;
    }
    .Contact_Intro-Right {
        font-size: 16px;
    }
}

//Form ------------- ---------------- ---------------
.Contact_Form {
    width: 100%;
    margin: 100px 0px;
}

    .Contact_Form-Wrap {
        width: 100%;
        position: relative;
    }

        .Contact_Form-Form {
            width: 100%;
        }

            .Contact_Form-Body {
                width: 100%;
            }

                .Contact_Form-Item-Container {
                    width: 100%;
                    opacity: 0;
                    transition: opacity;
                }

                    .Contact_Form-item {
                        width: 100%;
                        position: relative;

                    }
                        .Label1 {
                            margin-bottom: 30px;
                            margin-top: 70px;
                        }
